import React from "react"
import { Route } from "react-router-dom"

function userIsLoggedIn(){
    return false
}

export default function AppRouter(props){
    return(
        <Route
            path={props.path}
            render={props =>{
                props.isPrivate && !userIsLoggedIn() ? (<div>user not login</div>) : (<Component {... props} />)
            }}
            {... props}
        />
    )
}
